import React from "react";

function DriveVideoEmbed({ videoUrl, playing, onPlay }) {
    return (
        <div style={{ position: "relative", paddingTop: "56.25%" }}>
            <iframe
                src={`${videoUrl}?autoplay=${playing ? 1 : 0}`}
                style={{
                    position: "absolute",
                    top: 0,
                    left: 0,
                    width: "100%",
                    height: "100%",
                    border: "none",
                }}
                allow="autoplay"
                title="Google Drive Video"
                onPlay={onPlay} // Custom handler for play events
            ></iframe>
        </div>
    );
}

export default DriveVideoEmbed;
